import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';

function BasicExample({ user, onLogout, onLoginRegisterClick }) {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="#home">Your App</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Other Routes</Nav.Link>
            {user && user.role === 'patient' && (
              <Nav.Link href="#patient">Patient Page</Nav.Link>
            )}
            {user && user.role === 'doctor' && (
              <Nav.Link href="#doctor">Doctor Page</Nav.Link>
            )}
            {user && user.role === 'admin' && (
              <Nav.Link href="#admin">Admin Page</Nav.Link>
            )}
          </Nav>
          {user ? (
            <Navbar.Text>
              Signed in as: {user.name}
              <Button variant="link" onClick={onLogout}>
                Logout
              </Button>
            </Navbar.Text>
          ) : (
            <Button variant="primary" onClick={onLoginRegisterClick}>
              Login/Register
            </Button>
          )}
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default BasicExample;
